import React from "react";
import Footer from "../components/Footer";
import Navbar from "../components/Navbar";
import "./routesCss/Resume.css";

const Resume = () => {
	return (
		<div className="resumeContainerDiv">
			<div className="resumeTop"></div>
			<div className="resumeBottom">
				<div className="resumeProjects"></div>
				<div className="resumeExtra"></div>
			</div>
		</div>
	);
};

export default Resume;
